import React, { Component } from "react";

class Home extends Component {
  state = {};

  render() {
    return (
      <div style={styles.mainStyle}>
        <div style={styles.boxStyle} />
      </div>
    );
  }
}

const styles = {
  mainStyle: {
    display: "flex",
    alignItems: 'center',
    margin: "1.6%",
    marginLeft: '15%',
    marginRight: '15%',
    //backgroundColor: 'grey',
    flexDirection: 'column'
  },
  boxStyle: {
    display: 'flex',
    marginTop: '4%', 
    alignItems: 'center',
    flexDirection: 'column',
    height: 80,
    borderRadius: 4,
    boxShadow: "1px 1px 5px 2px #9E9E9E",
    //border: "1px solid black",
    width: '100%',
  }
};

export default Home;
